import React from 'react';
import '../App.css';
import { AppBar, Toolbar } from '@material-ui/core';


class Header extends React.Component {
    constructor(props) {
        super(props)
    }


    render() {
        return (
          <div>
              <AppBar position="static" style={{ backgroundColor: '#fff' }}>
                  <Toolbar>
                      Hello there
                  </Toolbar>
              </AppBar>
          </div>
        );
    }
}

export default Header;
